polishGetAPIUsageResponse.code:
function polishGetAPIUsageResponse(response) {
    Object.keys(response).forEach(key => {
        if (key.endsWith('_date')) response[key] = iml.parseDate(response[key], 'M/D/YYYY');
    });
    return response;
}

